import { Auth } from "@supabase/auth-ui-react";
import { supabase } from "../../../supabase";

const SocialLogin = () => (
  <>
    <Auth
      supabaseClient={supabase}
      providers={["google"]}
      queryParams={{
        access_type: "offline",
        prompt: "consent",
        hd: "domain.com",
      }}
      onlyThirdPartyProviders
    />
    <Auth
      supabaseClient={supabase}
      providers={["github"]}
      queryParams={{
        access_type: "offline",
        prompt: "consent",
        hd: "domain.com",
      }}
      onlyThirdPartyProviders
    />
  </>
);

export default SocialLogin;
